  PRIMARY KEY (`ID`),
  UNIQUE KEY `SERIAL_NO` (`SERIAL_NO`),
  UNIQUE KEY `I_UUID` (`UUID`),
  KEY `I_TYPE` (`TYPE`),
  KEY `I_HOTEL` (`HOTEL`),
  KEY `I_ROOM` (`ROOM`),
  KEY `I_INPUTER` (`INPUTER`)
